// ==UserScript==
// @name         Avi's IBM Log Exporter
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  IBM Log Exporter for IBM Cloud Log Analysis Service that allows you to export logs from IBM Cloud Log Analysis Service to your local machine in a zip file. Uses IBM Cloud Log Analysis Service Export API, and hence, requires Service ID to work.
// @updateURL    https://raw.githubusercontent.com/avinashkarhana/ibm-log-analysis-log-export/main/js-userscript/IBMLogAnalysisExportLogs.user.js
// @downloadURL  https://raw.githubusercontent.com/avinashkarhana/ibm-log-analysis-log-export/main/js-userscript/IBMLogAnalysisExportLogs.user.js
// @author       Avinash Karhana
// @match        https://*.logging.cloud.ibm.com/*
// @connect      *
// @grant        GM_xmlhttpRequest
// @require      https://cdnjs.cloudflare.com/ajax/libs/jszip/3.9.1/jszip.min.js
// ==/UserScript==

// Later versions of jszip than 3.9.1 are not stable

(function () {

    // Configuration and Variables
    var apps = [];
    var hosts = [];
    var serviceId = '';
    var fromTimestamp = 0;
    var toTimestamp = 0;
    var ibmLogAnalysisRegion = 'us-east';
    var apiPath = '/v2/export';
    var endpoint = '';

    // Function to make HTTP request
    async function makeHttpRequest(url, options) {
        return new Promise((resolve, reject) => {
            GM_xmlhttpRequest({
                method: options.method || 'GET',
                url,
                headers: options.headers || {},
                onload: function (response) {
                    resolve(response);
                },
                onerror: function (error) {
                    reject(error);
                },
            });
        });
    }

    // Function to get Serive ID from the user
    function getServiceId() {
        // Use prompt to get the service ID from the user and store it in global variable
        serviceId = prompt('Enter your Service ID:');
        if (serviceId === null) {
            alert('Log Export Aborted by User!\n');
            throw new Error('Log Export Aborted by User!\n\nUser refused to enter Service ID.');
        }
    }

    // Function to Build API Endpoint
    function buildApiEndpoint() {
        // Construct the API endpoint
        endpoint = `https://api.${ibmLogAnalysisRegion}.logging.cloud.ibm.com`;
    }

    function timestampStringToEST(timestampString) {
        let timestamp = parseInt(timestampString);
        // Check if the timestamp is in seconds (10 digits) and Convert to milliseconds
        if (timestampString.length === 10) {
            timestamp = timestamp * 1000;
        }
        const date = new Date(timestamp);
        const options = {
            year: 'numeric',
            month: '2-digit',
            day: '2-digit',
            hour: '2-digit',
            minute: '2-digit',
            second: '2-digit',
            timeZoneName: 'short',
            timeZone: 'America/New_York',
            hour12: false
        };
        const dateString = date.toLocaleString('en-US', options);
        // Manually format the dateString to the desired format
        const parts = dateString.split(', ');
        const [datePart, timePart] = parts;
        const dateParts = datePart.split("/");
        const year = dateParts[2];
        const month = dateParts[0];
        const day = dateParts[1];
        const formattedDate = `${year}-${month}-${day}`;
        const formattedDateString = `${formattedDate} ${timePart}`;

        return formattedDateString;
    }

    // Function to Log Export
    async function exportLogs() {
        try {
            // Get ibmLogAnalysisRegion from UI
            getIBMLogAnalysisRegion();

            // Build API Endpoint
            buildApiEndpoint();

            // Get Time Frame from UI
            getTimeFrame();

            // if fromTimestamp is greater than toTimestamp then swap them
            if (fromTimestamp > toTimestamp) {
                let temp = fromTimestamp;
                fromTimestamp = toTimestamp;
                toTimestamp = temp;
            }

            // if fromTimestamp and toTimestamp are 0 then ask for confirmation if user wants to export all logs of all time
            if (fromTimestamp === 0 && toTimestamp === 0) {
                const confirmation = confirm(`No specific time frame selected. \nAre you sure that you want to export all logs of all time. \nPress OK to continue or Cancel to abort.`);
                if (!confirmation) {
                    alert('Log Export Aborted by User!\n\nPlease select a time frame and try again.');
                    throw new Error('Log Export Aborted by User!\n\nUser refused to export logs without selecting a time frame.');
                }

                // Set fromTimestamp to 0
                fromTimestamp = 0;

                // Set toTimestamp to current timestamp
                toTimestamp = Math.floor(Date.now());
            }

            // if fromTimestamp and toTimestamp are same then show error
            if (fromTimestamp === toTimestamp) {
                alert('Error: From and To Timestamps are same!');
                return;
            }

            // Convert timestamps to JavaScript Date objects
            if (`${fromTimestamp}`.length === 10) {
                fromTimestamp = fromTimestamp * 1000;
            }
            if (`${toTimestamp}`.length === 10) {
                toTimestamp = toTimestamp * 1000;
            }

            // Convert datetime objects to EST time strings
            const parsedFromTimestampToESTString = timestampStringToEST(`${fromTimestamp}`);
            const parsedToTimestampToESTString = timestampStringToEST(`${toTimestamp}`);

            // Construct the full API URL
            const apiURL = `${endpoint}${apiPath}`;

            // Initialize paginationId to null
            let paginationId = null;

            // get selected hosts
            await getSelectedHosts();

            // get selected apps
            await getSelectedApps();

            // if hosts and apps are empty then ask for confirmation if user wants to export all logs
            if (hosts.length === 0 && apps.length === 0) {
                const confirmation = confirm(`No specific Source(hosts) or Apps selected. \nAre you sure that you want to export all logs from ${parsedFromTimestampToESTString} to ${parsedToTimestampToESTString}. \nPress OK to continue or Cancel to abort.`);
                if (!confirmation) {
                    alert('Log Export Aborted by User!\n\nPlease select some hosts or apps and try again.');
                    throw new Error('Log Export Aborted by User!\n\nUser refused to export logs without selecting hosts or apps.');
                }
            }

            if (hosts.length === 0) {
                hosts.push(null);
            }

            if (apps.length === 0) {
                apps.push(null);
            }

            // Show Export Log Notification
            changeExportLogNotificationIcon('inprogress');
            updateExportLogNotificationText('Exporting Log...');
            showExportLogNotification();

            // Log All Variables
            logAllVariables();

            const logItemArray = [];

            for (const host of hosts) {
                for (const appName of apps) {
                    // Create a directory for storing log files
                    const logsFolderName = `Logs/Logs_from_timestamp_${fromTimestamp}_to_timestamp_${toTimestamp}`;
                    let fileNamePrefix = 'All_source';

                    if (host) {
                        if (fileNamePrefix === 'All_source') {
                            fileNamePrefix = '';
                        }
                        fileNamePrefix += host;
                    }

                    if (appName) {
                        fileNamePrefix += `_${appName}`;
                    }

                    const logFileName = `${fileNamePrefix}-log.txt`;

                    // Create a Blob to accumulate log data
                    let logData = "";

                    console.log(`> Starting Log Backup in ${logFileName}`);

                    while (true) {
                        // Make the API request with parameters
                        const params = {
                            to: toTimestamp,
                            from: fromTimestamp,
                        };

                        if (host && host.length > 0) {
                            params.hosts = host;
                        }

                        if (appName && appName.length > 0) {
                            params.apps = appName;
                        }

                        if (paginationId) {
                            params.pagination_id = paginationId;
                        }

                        // Ask for Service ID if not provided
                        if (!serviceId) {
                            getServiceId();
                        }

                        // Perform the API request using the Fetch API (for simplicity, authentication is not included here)
                        const response = await makeHttpRequest(apiURL + '?' + new URLSearchParams(params), {
                            method: 'GET',
                            headers: {
                                'Authorization': 'Basic ' + btoa(serviceId + ':')
                            }
                        });

                        // Check if the request was successful (status code 200)
                        if (response.status >= 200 && response.status < 300) {
                            // Parse the JSON response
                            const data = JSON.parse(response.responseText);

                            // Extract the "lines" property from the JSON data
                            const lineData = data.lines || [];

                            if (lineData.length > 0) {
                                // Process and append the log data to the Blob
                                const textToAppend = lineData.map(item => {
                                    let line = "";
                                    if (item._ts) {
                                        line += timestampStringToEST(`${item._ts}`);
                                    }
                                    if (item._host) {
                                        line += ` ${item._host}`;
                                    }
                                    if (item._ip) {
                                        line += ` ${item._ip}`;
                                    }
                                    if (item.pod) {
                                        line += ` ${item.pod}`;
                                    }
                                    if (item._app) {
                                        line += ` ${item._app}`;
                                    }
                                    if (item._line) {
                                        if (item._logtype === "json") {
                                            try {
                                                line += ` ${JSON.parse(item._line).message}`;
                                            }
                                            catch {
                                                line += ` ${item._line}`;
                                            }
                                        }
                                        else {
                                            line += ` ${item._line}`;
                                        }
                                    }
                                    return line;
                                }).join('\n');

                                // Append the text to the logBlob
                                logData += textToAppend;
                            }

                            // Get the paginationId from the response
                            paginationId = data.pagination_id;

                            // If there's no more paginationId, exit the loop
                            if (!paginationId) {
                                break;
                            }
                        } else {
                            throw new Error(`Failed to fetch data from the API.\nStatus code: ${response.status}`);
                        }
                    }

                    // Log backup completed for this host and app
                    console.log(`# Done taking Log Backup in ${logFileName}`);

                    // Add the Blob to the logItemArray
                    logItemArray.push({ name: logFileName, data: logData });
                }
            }

            // Create the README.txt with formatted variables
            let readmeTxt = 'Logs from following:\n';

            logItemArray.forEach(item => {
                readmeTxt += `    - ${item.name}`
                if (item.data.trim().length == 0) {
                    readmeTxt += "(Blank)"
                }
                readmeTxt += "\n";
            });

            readmeTxt += `\nThese logs are from the following time frame:
    - From unix timestamp: ${fromTimestamp} (${parsedFromTimestampToESTString})
    - To unix timestamp: ${toTimestamp} (${parsedToTimestampToESTString})`;

            // Add the readme.txt blob to the logItemArray
            logItemArray.push({ name: 'README.txt', data: readmeTxt });

            // Create a zip file
            const zip = new JSZip();

            for (let i = 0; i < logItemArray.length; i++) {
                let item = logItemArray[i];
                zip.file(item.name, item.data);
            }

            console.log(logItemArray);
            updateExportLogNotificationText("Log Export: Zipping Logs")

            // Generate the zip file as a Blob
            let zipResp = zip.generateAsync({ type: 'blob' })
                .then(function (content) {
                    // Create a download link for the zip file
                    const downloadLink = document.createElement('a');
                    downloadLink.href = URL.createObjectURL(content);
                    downloadLink.download = 'Log_data.zip';
                    downloadLink.textContent = 'Download All Logs';

                    // Append the download link to the document
                    document.body.appendChild(downloadLink);
                    downloadLink.click();
                    // Remove the download link from the document
                    downloadLink.remove();

                    // make Export Log Notification Success and hide it after 5 seconds
                    changeExportLogNotificationIcon('success');
                    updateExportLogNotificationText('Log Exported Successfully, If not downloaded check Console Logs you can find data there as well');
                    setTimeout(hideExportLogNotification, 5000);
                });
            console.log(zipResp);


        } catch (error) {
            console.error("An error occurred:", error);
            // make Export Log Notification Error and hide it after 8 seconds
            changeExportLogNotificationIcon('error');
            let notificationText = 'Error Exporting Log: More details in console';
            // if error is due to user aborting then show different message
            if (error.message === 'Log Export Aborted by User!\n\nUser refused to enter Service ID.') {
                notificationText = 'Log Export Aborted by User!';
            }
            if (error.message === 'Log Export Aborted by User!\n\nUser refused to export logs without selecting a time frame.') {
                notificationText = 'Log Export Aborted by User!';
            }
            if (error.message === 'Log Export Aborted by User!\n\nUser refused to export logs without selecting hosts or apps.') {
                notificationText = 'Log Export Aborted by User!';
            }
            updateExportLogNotificationText(notificationText);
            showExportLogNotification();
            setTimeout(hideExportLogNotification, 8000);
        }
    }

    // Function to create Export Log Notification
    function createExportLogNotification() {
        let overlay;
        // create overlay if already not present
        if (document.getElementById('log-export-notification-overlay') === null) {
            overlay = document.createElement('div');
            overlay.id = 'log-export-notification-overlay';
            overlay.style.display = 'none';
        }
        else {
            overlay = document.getElementById('log-export-notification-overlay');
        }

        // Apply styles to the overlay
        overlay.style.position = 'fixed';
        overlay.style.top = '0';
        overlay.style.right = '0';
        overlay.style.width = '30%';
        overlay.style.height = '10%';
        overlay.style.backgroundColor = 'rgba(0, 0, 0, 0.7)';
        overlay.style.borderRadius = '10px';
        overlay.style.zIndex = '999';

        // Add Icon to overlay to left of text if not already present
        let exportLogNotificationIcon;
        if (document.getElementById('log-export-notification-icon') === null) {
            exportLogNotificationIcon = document.createElement('img');
            exportLogNotificationIcon.id = 'log-export-notification-icon';
            exportLogNotificationIcon.src = '';
        }
        else {
            exportLogNotificationIcon = document.getElementById('log-export-notification-icon');
        }
        exportLogNotificationIcon.style.position = 'absolute';
        exportLogNotificationIcon.style.top = '20%';
        exportLogNotificationIcon.style.left = '5%';
        exportLogNotificationIcon.style.height = '60%';

        // Add Icon to overlay if not already present
        if (document.getElementById('log-export-notification-icon') === null) {
            overlay.appendChild(exportLogNotificationIcon);
        }

        // Add Text div to the overlay to right of Icon if not already present
        let exportLogNotificationText;
        if (document.getElementById('log-export-notification-text') === null) {
            exportLogNotificationText = document.createElement('div');
            exportLogNotificationText.id = 'log-export-notification-text';
            exportLogNotificationText.innerText = 'Exporting Log...';
        }
        else {
            exportLogNotificationText = document.getElementById('log-export-notification-text');
        }
        exportLogNotificationText.style.position = 'absolute';
        exportLogNotificationText.style.top = '20%';
        exportLogNotificationText.style.left = '20%';
        exportLogNotificationText.style.width = '70%';
        exportLogNotificationText.style.height = '58.45%';
        exportLogNotificationText.style.color = 'white';
        exportLogNotificationText.style.fontSize = '1.5em';

        // Add exportLogNotificationText to overlay if not already present
        if (document.getElementById('log-export-notification-text') === null) {
            overlay.appendChild(exportLogNotificationText);
        }

        // Add overlay to body if not already present
        if (document.getElementById('log-export-notification-overlay') === null) {
            document.body.appendChild(overlay);
        }
    }

    // Function to show Export Log Notification
    function showExportLogNotification() {
        createExportLogNotification();
        document.getElementById('log-export-notification-overlay').style.display = 'block';
    }

    // Function to hide Export Log Notification
    function hideExportLogNotification() {
        document.getElementById('log-export-notification-overlay').style.display = 'none';
    }

    // Function to change Export Log Notification Icon
    function changeExportLogNotificationIcon(state) {
        createExportLogNotification();

        // if state is inprogress or error or success then change icon accordingly
        let iconSrc;
        if (state === 'inprogress') {
            iconSrc = "data:image/gif;base64,";
        }
        else if (state === 'error') {
            iconSrc = "data:image/gif;base64,";
        }
        else if (state === 'success') {
            iconSrc = "data:image/gif;base64,";
            document.getElementById('log-export-notification-icon').style.width = "60px";
        }
        else {
            iconSrc = "data:image/png;base64,";
        }
        document.getElementById('log-export-notification-icon').setAttribute('src', iconSrc);
    }

    // Function to update Export Log Notification Text
    function updateExportLogNotificationText(text) {
        createExportLogNotification();
        document.getElementById('log-export-notification-text').innerText = text;
    }

    // Function to Convert "" like formatted Dat Time to Timestamp
    function parseDateTimeToTimestamp(dateTimeStr) {
        try {
            const [dateStr, timeStr] = dateTimeStr.split(' ');

            const [day, month] = dateStr.split('/');
            const [hours, minutes, seconds] = timeStr.split(':');

            // JavaScript Date uses 0-based months, so we subtract 1 from the month
            const year = new Date().getFullYear(); // You may need to adjust this based on the context

            const timestamp = new Date(year, month - 1, day, hours, minutes, seconds).getTime();
            return timestamp;
        }
        catch {
            console.error('Error: Invalid Date Time String');
            return 0;
        }
    }

    // Function to Get from_timestamp and to_timestamp from user
    function getTimeFrame() {
        try {
            let timeFrameString = document.getElementById('search').getElementsByClassName('timerange-controls')[0].getElementsByTagName('input')[0].value;
            let [fromDateTimeStr, toDateTimeStr] = timeFrameString.split(' to ');
            fromTimestamp = parseDateTimeToTimestamp(fromDateTimeStr);
            // id timeFrameString has no " to " string but length 14 or greater then set to timestamp to current timestamp
            if (toDateTimeStr == undefined && timeFrameString.length >= 14 && !timeFrameString.includes(" to ")) {
                toTimestamp = new Date().getTime();
            }
            else {
                toTimestamp = parseDateTimeToTimestamp(toDateTimeStr);
            }
        } catch { }
    }

    // Function to get ibmLogAnalysisRegion
    function getIBMLogAnalysisRegion() {
        ibmLogAnalysisRegion = window.location.hostname.split('.')[1];
    }

    // Function to get selected hosts
    async function getSelectedHosts() {
        var hostFilterMenu = document.getElementById('filter-menu-hosts');
        hostFilterMenu.getElementsByClassName('filter-title')[0].click();
        let promise = new Promise((resolve, reject) => {
            setTimeout(() => {
                let selectedHosts = hostFilterMenu.getElementsByClassName('applied-filters')[0].getElementsByClassName('filter-section')[0].getElementsByTagName('input');
                hosts = [];
                for (let i = 0; i < selectedHosts.length; i++) {
                    hosts.push(selectedHosts[i].value);
                }
                console.log("Selected Hosts:", hosts);
                document.body.click();
                setTimeout(resolve, 100);
            }, 100);
        });
        return promise;
    }

    // Function to get selected apps
    async function getSelectedApps() {
        var appFilterMenu = document.getElementById('filter-menu-apps')
        appFilterMenu.getElementsByClassName('filter-title')[0].click();
        let promise = new Promise((resolve, reject) => {
            setTimeout(() => {
                let selectedApps = appFilterMenu.getElementsByClassName('applied-filters')[0].getElementsByClassName('filter-section')[0].getElementsByTagName('input');
                apps = [];
                for (let i = 0; i < selectedApps.length; i++) {
                    apps.push(selectedApps[i].value);
                }
                console.log("Selected Apps:", apps);
                document.body.click();
                setTimeout(resolve, 100);
            }, 100);
        });
        return promise;
    }

    // Function to console log All Variables
    function logAllVariables() {
        console.log("ibmLogAnalysisRegion:", ibmLogAnalysisRegion);
        console.log("endpoint:", endpoint);
        if (serviceId) {
            console.log("serviceId:", "serviceId is present");
        }
        else {
            console.log("serviceId:", "serviceId is not present");
        }
        console.log("fromTimestamp:", fromTimestamp);
        console.log("toTimestamp:", toTimestamp);
        console.log("hosts:", hosts);
        console.log("apps:", apps);
    }

    // Function to add Export Log Button
    function addLogExportButton() {
        let filterHeaderBar = document.querySelector("#header .control-header .view-name__transition");

        // Create Export Log Button
        let exportLogButton = document.createElement('button');
        exportLogButton.id = 'export-log-button';
        exportLogButton.style.color = 'white';
        exportLogButton.style.padding = '0.7em';
        exportLogButton.style.fontSize = '1.3em';
        exportLogButton.style.background = 'blueviolet';
        exportLogButton.style.fontFamily = 'Source Sans Pro';
        exportLogButton.innerText = 'Export Logs';

        // Add Export Log Button to FilterHeaderBar
        filterHeaderBar.appendChild(exportLogButton);

        // Add Event Listener to Export Log Button
        exportLogButton.addEventListener('click', async () => {
            // Export Logs
            exportLogs();
        });
    }

    setTimeout(() => {
            // Add Export Log Button
            addLogExportButton();

            // Create Export Log Notification
            createExportLogNotification();
    }, 5000);
    setInterval(() => {
            if (!document.querySelector("#export-log-button")) {
                // Add Export Log Button
                addLogExportButton();

            // Create Export Log Notification
            createExportLogNotification();
            }
    }, 5000);
})();